import React from 'react';
import {
  AppBar,
  Box,
  Toolbar,
  Typography,
  Button,
  Container,
  IconButton,
  Avatar,
  Menu,
  MenuItem,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import CodeIcon from '@mui/icons-material/Code';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

const Navbar = () => {
  const navigate = useNavigate();
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar 
        position="fixed"
        sx={{ 
          background: '#1a1a1a !important',
          backgroundImage: 'none !important',
          boxShadow: 'none',
          borderBottom: '1px solid rgba(255,255,255,0.1)'
        }}
      >
        <Container maxWidth="lg">
          <Toolbar 
            sx={{ 
              minHeight: '60px !important',
              background: '#1a1a1a !important'
            }}
          >
            {/* Logo and Brand */}
            <Box 
              sx={{ 
                display: 'flex', 
                alignItems: 'center',
                cursor: 'pointer'
              }}
              onClick={() => navigate('/')}
            >
              <CodeIcon sx={{ color: '#ffa116', mr: 1 }} />
              <Typography
                variant="h6"
                sx={{
                  fontWeight: 600,
                  fontSize: '1.25rem',
                  color: '#ffffff',
                  display: 'flex',
                  alignItems: 'center'
                }}
              >
                Machine Coding Platform
              </Typography>
            </Box>

            {/* Navigation Links */}
            <Box sx={{ ml: 4, display: 'flex', alignItems: 'center', flex: 1 }}>
              <Button
                sx={{
                  color: '#ffffff !important',
                  fontSize: '0.9rem',
                  minWidth: 'auto',
                  px: 2,
                  py: 1,
                  '&:hover': { 
                    color: '#ffa116 !important',
                    backgroundColor: 'rgba(255, 161, 22, 0.1)'
                  }
                }}
                onClick={() => navigate('/topics')}
              >
                Problems
              </Button>
              <Button
                endIcon={<KeyboardArrowDownIcon />}
                sx={{
                  color: '#ffffff !important',
                  fontSize: '0.9rem',
                  minWidth: 'auto',
                  px: 2,
                  py: 1,
                  '&:hover': { 
                    color: '#ffa116 !important',
                    backgroundColor: 'rgba(255, 161, 22, 0.1)'
                  }
                }}
                onClick={handleClick}
              >
                Learn
              </Button>
              <Menu
                anchorEl={anchorEl}
                open={open}
                onClose={handleClose}
                PaperProps={{
                  sx: {
                    backgroundColor: '#1a1a1a !important',
                    color: '#ffffff',
                    border: '1px solid rgba(255,255,255,0.1)',
                    boxShadow: '0 3px 8px rgba(0,0,0,0.2)'
                  }
                }}
              >
                <MenuItem 
                  onClick={() => { handleClose(); navigate('/tutorials'); }}
                  sx={{
                    '&:hover': { backgroundColor: 'rgba(255, 161, 22, 0.1)' }
                  }}
                >
                  Tutorials
                </MenuItem>
                <MenuItem 
                  onClick={() => { handleClose(); navigate('/guides'); }}
                  sx={{
                    '&:hover': { backgroundColor: 'rgba(255, 161, 22, 0.1)' }
                  }}
                >
                  Coding Guides
                </MenuItem>
              </Menu>
            </Box>

            {/* Right Side Actions */}
            <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
              <Button
                variant="contained"
                sx={{
                  bgcolor: '#ffa116 !important',
                  color: '#ffffff !important',
                  '&:hover': { 
                    bgcolor: '#ff9100 !important',
                    boxShadow: '0 2px 8px rgba(255, 161, 22, 0.4)'
                  },
                  textTransform: 'none',
                  px: 3,
                  py: 1,
                  fontWeight: 500
                }}
                onClick={() => navigate('/premium')}
              >
                Premium
              </Button>
              <IconButton
                sx={{
                  ml: 1,
                  border: '1px solid rgba(255,255,255,0.2)',
                  borderRadius: 2,
                  p: 1,
                  '&:hover': {
                    bgcolor: 'rgba(255,255,255,0.1)'
                  }
                }}
                onClick={() => navigate('/profile')}
              >
                <Avatar 
                  sx={{ 
                    width: 24, 
                    height: 24,
                    bgcolor: 'rgba(255,255,255,0.1)',
                    color: '#ffffff',
                    fontSize: '0.875rem'
                  }}
                >
                  U
                </Avatar>
              </IconButton>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
      <Toolbar /> {/* This creates space below the fixed navbar */}
    </Box>
  );
};

export default Navbar;
